import { AppShell, Button, Card, Grid, Group, Title } from "@mantine/core";
import BingoState, { BingoStates } from "../BingoState";

import { useState } from "react";
import BingoList from "./BingoList";
import Rules from "./Rules";
import Spinner from "./Spinner";

function App() {
  const [bingoState, setBingoState] = useState(() => BingoState());
  const [spinState, setSpinState] = useState(false);

  return (
    <AppShell
      padding="md"
      header={{ height: 50 }}
      style={{
        background:
          "url('data:image/png;base64,')",
      }}
    >
      <AppShell.Header px="md" className="font-heading" h={50} bg="primary.9">
        <Title order={1} className="before:content-(--title)">
          &nbsp;
        </Title>
      </AppShell.Header>
      <AppShell.Main className="font-body">
        <Grid>
          <Grid.Col span={7}>
            <Card>
              <BingoList bingoState={bingoState} />
            </Card>
          </Grid.Col>
          <Grid.Col span={5}>
            <Card
              bg="primary.8"
              className="flex place-content-center place-items-center"
              h="100%"
            >
              <Spinner bingoState={bingoState} spinState={spinState} />
            </Card>
          </Grid.Col>
        </Grid>
      </AppShell.Main>
      <AppShell.Footer px="md" bg="primary.9">
        <Group>
          <Button
            size="lg"
            radius="lg"
            color="secondary.9"
            disabled={spinState}
            onClick={() => {
              setSpinState(true);
              setBingoState((prev) => {
                const prevBingoState = { ...prev };
                if (
                  prevBingoState.activeIndex >=
                  prevBingoState.history.length - 1
                )
                  return prevBingoState;
                if (prevBingoState.activeIndex > -1)
                  prevBingoState.values[
                    prevBingoState.history[prevBingoState.activeIndex]
                  ].value = BingoStates.visible;
                prevBingoState.values[
                  prevBingoState.history[prevBingoState.activeIndex + 1]
                ].value = BingoStates.picked;
                prevBingoState.activeIndex = prevBingoState.activeIndex + 1;
                return prevBingoState;
              });
              setTimeout(() => setSpinState(false), 2000);
            }}
          >
            SPIN
          </Button>
          <Button
            size="lg"
            variant="light"
            color="neutral"
            radius="lg"
            onClick={() =>
              confirm("Are you sure you want to reset?") && location.reload()
            }
          >
            Reset
          </Button>
          <Rules />
        </Group>
      </AppShell.Footer>
    </AppShell>
  );
}

export default App;
